class TestCommands : public QObject
{
    Q_OBJECT

public:
    TestCommands();
    ~TestCommands();

private slots:
    void initTestCase();
    void cleanupTestCase();
    void testDeleteCommandConstructor();
    void testDeleteCommandRedoUndo();
};

TestCommands::TestCommands() {}

TestCommands::~TestCommands() {}

void TestCommands::initTestCase() {}

void TestCommands::cleanupTestCase() {}

void TestCommands::testDeleteCommandConstructor()
{
    QGraphicsScene scene;
    QGraphicsRectItem *item = new QGraphicsRectItem(0, 0, 100, 100);
    scene.addItem(item);

    DeleteCommand cmd(item, &scene);
    QCOMPARE(cmd.m_item, item);
    QCOMPARE(cmd.m_scene, &scene);
    QCOMPARE(cmd.m_itemPos, item->pos());
    QCOMPARE(cmd.m_itemSize, item->boundingRect().size());
}

void TestCommands::testDeleteCommandRedoUndo()
{
    QGraphicsScene scene;
    QGraphicsRectItem *item = new QGraphicsRectItem(0, 0, 100, 100);
    scene.addItem(item);

    QVERIFY(scene.items().contains(item));

    DeleteCommand *cmd = new DeleteCommand(item, &scene);
    cmd->redo();

    QVERIFY(!scene.items().contains(item));

    cmd->undo();
    QVERIFY(scene.items().contains(item));

    delete cmd;
}

QTEST_MAIN(TestCommands)
