class TestDiagramItem : public QObject
{
    Q_OBJECT

public:
    TestDiagramItem();
    ~TestDiagramItem();

private slots:
    void initTestCase();
    void cleanupTestCase();
    void testDiagramItemCreation();
    void testDiagramItemTypes();
    void testDiagramItemBoundingRect();
    void testDiagramItemColor();
    void testDiagramItemRotation();
    void testDiagramItemSize();
    void testDiagramItemText();
    void testArrowCreation();
    void testDiagramPathCreation();
    void testDeleteCommand();
    void testFindReplaceDialog();
    void testDiagramItemGroup();

private:
    QGraphicsScene *scene;
    QMenu *contextMenu;
};

TestDiagramItem::TestDiagramItem()
{
}

TestDiagramItem::~TestDiagramItem()
{
}

void TestDiagramItem::initTestCase()
{
    // Initialize Qt application if needed for widgets
    static int argc = 1;
    static char *argv[] = { (char*)"test" };
    if (QApplication::instance() == nullptr) {
        new QApplication(argc, argv);
    }

    scene = new QGraphicsScene();
    contextMenu = new QMenu();
}

void TestDiagramItem::cleanupTestCase()
{
    delete scene;
    delete contextMenu;
}

void TestDiagramItem::testDiagramItemCreation()
{
    DiagramItem *item = new DiagramItem(DiagramItem::Step, contextMenu);
    QVERIFY(item != nullptr);
    QCOMPARE(item->diagramType(), DiagramItem::Step);

    scene->addItem(item);
    QVERIFY(scene->items().contains(item));

    delete item;
}

void TestDiagramItem::testDiagramItemTypes()
{
    QList<DiagramItem::DiagramType> types = {
        DiagramItem::Step,
        DiagramItem::Conditional,
        DiagramItem::StartEnd,
        DiagramItem::circular,
        DiagramItem::Document,
        DiagramItem::PredefinedProcess,
        DiagramItem::StoredData
    };

    for (auto type : types) {
        DiagramItem *item = new DiagramItem(type, contextMenu);
        QVERIFY(item != nullptr);
        QCOMPARE(item->diagramType(), type);
        delete item;
    }
}

void TestDiagramItem::testDiagramItemBoundingRect()
{
    DiagramItem *item = new DiagramItem(DiagramItem::Step, contextMenu);
    QRectF rect = item->boundingRect();
    QVERIFY(rect.isValid());
    QVERIFY(!rect.isEmpty());
    delete item;
}

void TestDiagramItem::testDiagramItemColor()
{
    DiagramItem *item = new DiagramItem(DiagramItem::Step, contextMenu);
    QColor originalColor = Qt::white;
    QColor testColor = Qt::red;

    // Note: We can't directly verify the internal color state without getter
    // This test assumes setBrush works correctly
    item->setBrush(testColor);

    // The item should still exist and be valid after color change
    QVERIFY(item != nullptr);
    QVERIFY(item->boundingRect().isValid());

    delete item;
}

void TestDiagramItem::testDiagramItemRotation()
{
    DiagramItem *item = new DiagramItem(DiagramItem::Step, contextMenu);

    // Test initial rotation
    QCOMPARE(item->rotationAngle(), 0.0);

    // Test setting rotation
    item->setRotationAngle(45.0);
    QCOMPARE(item->rotationAngle(), 45.0);

    // Bounding rect should still be valid after rotation
    QVERIFY(item->boundingRect().isValid());

    delete item;
}

void TestDiagramItem::testDiagramItemSize()
{
    DiagramItem *item = new DiagramItem(DiagramItem::Step, contextMenu);
    QSizeF originalSize = QSizeF(150, 100);
    QSizeF newSize = QSizeF(200, 150);

    // Initial size should match constructor
    // Note: We can't verify without a getter, but we can test that
    // setFixedSize doesn't crash and bounding rect remains valid
    item->setFixedSize(newSize);
    QVERIFY(item->boundingRect().isValid());

    delete item;
}

void TestDiagramItem::testDiagramItemText()
{
    DiagramItem *item = new DiagramItem(DiagramItem::Step, contextMenu);

    // The item should have a text item child
    QList<QGraphicsItem *> children = item->childItems();
    bool hasTextItem = false;
    for (QGraphicsItem *child : children) {
        if (qgraphicsitem_cast<DiagramTextItem*>(child)) {
            hasTextItem = true;
            break;
        }
    }
    QVERIFY(hasTextItem);

    delete item;
}

void TestDiagramItem::testArrowCreation()
{
    DiagramItem *startItem = new DiagramItem(DiagramItem::Step, contextMenu);
    DiagramItem *endItem = new DiagramItem(DiagramItem::Step, contextMenu);

    Arrow *arrow = new Arrow(startItem, endItem);
    QVERIFY(arrow != nullptr);
    QVERIFY(arrow->startItem() == startItem);
    QVERIFY(arrow->endItem() == endItem);

    // Test bounding rect
    QVERIFY(arrow->boundingRect().isValid());

    delete arrow;
    delete startItem;
    delete endItem;
}

void TestDiagramItem::testDiagramPathCreation()
{
    DiagramItem *startItem = new DiagramItem(DiagramItem::Step, contextMenu);
    DiagramItem *endItem = new DiagramItem(DiagramItem::Step, contextMenu);

    DiagramPath *path = new DiagramPath(startItem, endItem, 
                                        DiagramItem::TF_Right, 
                                        DiagramItem::TF_Left);
    QVERIFY(path != nullptr);
    QVERIFY(path->getStartItem() == startItem);
    QVERIFY(path->getEndItem() == endItem);

    // Path should have a valid QPainterPath
    QVERIFY(!path->path().isEmpty());

    delete path;
    delete startItem;
    delete endItem;
}

void TestDiagramItem::testDeleteCommand()
{
    QGraphicsScene testScene;
    DiagramItem *item = new DiagramItem(DiagramItem::Step, contextMenu);
    testScene.addItem(item);

    DeleteCommand *cmd = new DeleteCommand(item, &testScene);
    QVERIFY(cmd != nullptr);

    // Test redo (delete)
    cmd->redo();
    QVERIFY(!testScene.items().contains(item));

    // Test undo (restore)
    cmd->undo();
    QVERIFY(testScene.items().contains(item));

    delete cmd;
    delete item;
}

void TestDiagramItem::testFindReplaceDialog()
{
    FindReplaceDialog *dialog = new FindReplaceDialog();
    QVERIFY(dialog != nullptr);

    // Dialog should be created and visible
    QVERIFY(dialog->isWindow());

    delete dialog;
}

void TestDiagramItem::testDiagramItemGroup()
{
    DiagramItemGroup *group = new DiagramItemGroup();
    QVERIFY(group != nullptr);

    // Test bounding rect
    QRectF rect = group->boundingRect();
    QVERIFY(rect.isValid());

    // Test adding items
    DiagramItem *item1 = new DiagramItem(DiagramItem::Step, contextMenu);
    DiagramItem *item2 = new DiagramItem(DiagramItem::Conditional, contextMenu);

    group->addItem(item1);
    group->addItem(item2);

    // Group should contain the items
    QVERIFY(group->childItems().contains(item1));
    QVERIFY(group->childItems().contains(item2));

    delete group;
    // Note: items are deleted when group is deleted
}

